r Hosting</li>\r\n</ul>\r\n','A quick summary of services.','full_html'),('node','page',0,3,3,'und',0,'<div class=\"row\">\r\n	<div class=\"col-md-6\">\r\n		<h3><i class=\"fa fa-laptop\" style=\"font-size:24px;color:#00aced;\"></i>&nbsp;Personal Computers, Printing, and Other Devices</h3>\r\n		<ul>\r\n			<li>Phone & Mobile</li>\r\n		</ul>\r\n		<h3><i class=\"fa fa-wrench\" style=\"font-size:24px;color:#00aced;\"></i>&nbsp;Technical Services</h3>\r\n		<ul>\r\n			<li>Accounting and System Access</li>\r\n			<li>Information Sercurity</li>\r\n		</ul>\r\n		<h3><i class=\"fa fa-stethoscope\" style=\"font-size:24px;color:#00aced;\"></i>&nbsp;Personnel Resources</h3>\r\n		<ul>\r\n			<li>Training and Resources</li>\r\n			<li>On Boarding / Off Boarding</li>\r\n		</ul>\r\n  </div>\r\n  <div class=\"col-md-6\">\r\n		<h3><i class=\"fa fa-mortar-board\" style=\"font-size:24px;color:#00aced;\"></i>&nbsp;Research Computing and Data Analytics</h3>\r\n		<ul>\r\n			<li>Analysis Tools</li>\r\n		</ul>\r\n		<h3><i class=\"fa fa-mobile-phone\" style=\"font-size:24px;color:#00aced;\"></i>&nbsp;Communication, Collaboration, and Conference Rooms</h3>\r\n		<ul>\r\n			<li>Document and Digital Asset Services</li>\r\n			<li>Software Buisiness Apps & Email</li>\r\n		</ul>\r\n  </div>\r\n</div>','','full_html'),('node','page',0,5,5,'und',0,'<div id=\"content-core\">\r\n\r\n<p>For general questions about CBIIT, or for CBIIT Application Support, email <a title=\"\" target=\"_self\" href=\"mailto:mailto:ncicbiit@mail.nih.gov\" class=\"email-link\" onclick=\"trackOutboundLink(this,\'Outbound Links\', \'mailto:mailto:ncicbiit@mail.nih.gov\'); return false;\">ncicbiit@mail.nih.gov</a>.</p>\r\n\r\n<p>To contact CBIIT Application Support by telephone, call 240-276-5541 or toll free 888-478-4423. Telephone support is available Monday to Friday, 9:00 a.m. to 5:00 p.m. Eastern Time, excluding government holidays.</p>\r\n\r\n<p>NCI employees can also visit the <a title=\"NCI Computer Services Intranet\" target=\"_blank\" href=\"http://ncs.cancer.gov\" onclick=\"trackOutboundLink(this,\'Outbound Links\', \'http://ncs.cancer.gov\'); return false;\">NCI Computer Services Intranet</a> for more information about services provided to the NCI enterprise.</p>\r\n\r\n<p><a title=\"\" target=\"_self\" href=\"../resolveuid/453a166d-61fa-4d09-8be1-1982936ed407\" class=\"internal-link\">The CBIIT staff directory</a> lists specific contact information for CBIIT staff.</p>\r\n\r\n<p>\r\n<a href=\"https://twitter.com/nci_ncip\"><i class=\"fa fa-twitter\" style=\"font-size:24px;color:#00aced;\"></i> Twitter</a>\r\n</p>\r\n</div>','Contact CBIIIT','full_html'),('node','page',0,6,6,'und',0,'<form class=\"form-inline\">\r\n  <div class=\"row\">\r\n  <div class=\"form-group\">\r\n    <label for=\"exampleInputName2\">Name</label>\r\n    <input type=\"text\" class=\"form-control\" id=\"exampleInputName2\" placeholder=\"Jane Doe\">\r\n  </div>\r\n  <div class=\"form-group\">\r\n    <label for=\"exampleInputEmail2\">Email</label>\r\n    <input type=\"email\" class=\"form-control\" id=\"exampleInputEmail2\" placeholder=\"jane.doe@example.com\">\r\n  </div>\r\n</div>\r\n  <div class=\"form-group row\">\r\n    <label>Comment / Feedback</label>\r\n    <textarea placeholder=\"This is a really nice site.\" cols=\"80\" rows=\"5\"></textarea>\r\n  </div>\r\n\r\n  <button type=\"submit\" class=\"btn btn-primary\" style=\"margin-top:10px;\">Submit Feedback</button>\r\n</form>','We appreciate your feedback.','full_html'),('node','page',0,7,7,'und',0,'Here is your ticket status....\r\n\r\n<table cellspacing=\"3\" border=\"3\" align=\"center\" style=\"border-width: 3px; border-color: #cccccc; border-style: solid\">\r\n<tbody>\r\n<tr>\r\n<td style=\"background-color: #ffcc99\"><strong>Status Group&nbsp;</strong></td>\r\n<td style=\"background-color: #ffcc99\"><strong>Ticket Status&nbsp;</strong></td>\r\n</tr>\r\n<tr>\r\n<td align=\"center\" style=\"background-color: #ccff33\" rowspan=\"5\"><strong>&nbsp;Open</strong></td>\r\n<td style=\"background-color: #ccff33\">New&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #ccff33\">Assigned&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #ccff33\">In progress&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #ccff33\">Information requested&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #ccff33\">Hold</td>\r\n</tr>\r\n<tr>\r\n<td align=\"center\" style=\"background-color: #ccffff\" rowspan=\"2\"><strong>&nbsp;Resolved</strong></td>\r\n<td style=\"background-color: #ccffff\">Solved&nbsp;</td>\r\n</tr>\r\n<tr>\r\n<td style=\"background-color: #ccffff\">Closed&nbsp;</td>\r\n</tr>\r\n</tbody>\r\n</table>','','full_html');
